"""
Product of Array Except Self
- 
https://leetcode.com/problems/product-of-array-except-self/description/
"""

class Solution(object):
    def productExceptSelf(self, nums):
        """
        :type nums: List[int]
        :rtype: List[int]
        """
        prefix = 1
        postfix = 1

        length = len(nums)
        output = [1] * length

        for i in range(length):
            output[length-1-i] *= postfix
            postfix *= nums[length-1-i]
            output[i] *= prefix
            prefix *= nums[i]
        return output

class Solution2(object):
    def productExceptSelf(self, nums):
        """
        :type nums: List[int]
        :rtype: List[int]
        """
        n = len(nums)
        result = [0] * n
        for i in range(n):
            product = 1
            for j in range(n):
                if i == j:
                    continue
                product *= nums[j]
            result[i] = product
        return result


